import React from 'react';
import styled from 'styled-components';
import { Input } from 'antd';

const RightContentWrapper = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: flex-end;
  align-items: flex-end;
  width: 50%;
`;

const ChatWrapper = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: space-between;
  align-items: flex-end;
  height: 700px;
  width: 500px;
  border-radius: 20px 20px 0 0;
  border: 30px solid #6681d6;
  border-bottom: 0;
`;

const DefaultComandsWrapper = styled.div`
  display: flex;
  justify-content: space-between;
  flex-wrap: wrap;
  max-height: 150px;
  /* background: pink; */
  padding: 5px;
  overflow-y: auto;
`;

const DefaultComandWrap = styled.div`
  font-family: 'Roboto';
  color: white;
  border-radius: 5px;
  background: #6681d6;
  margin: 5px;
  padding: 4px 15px;
  cursor: pointer;
`;

const statusComanda = {
  IN_PROCESARE: 'IN_PROCESARE',
  CONFIRMATA: 'CONFIRMATA',
  PRELUATA_DE_CURIER: 'PRELUATA_DE_CURIER',
  IN_TRANZIT: 'IN_TRANZIT',
  LIVRATA: 'LIVRATA'
};

const data = {
  status_coamnda: {
    response: 'Buna ziua, introduceti numarul comenzii.',
    numar_comanda: [
      {
        numar_comanda: '123',
        status: statusComanda.IN_PROCESARE
      },
      {
        numar_comanda: '1234',
        status: statusComanda.IN_TRANZIT
      },
      {
        numar_comanda: '12345',
        status: statusComanda.PRELUATA_DE_CURIER
      },
      {
        numar_comanda: '123456',
        status: statusComanda.CONFIRMATA
      },
      {
        numar_comanda: '123456',
        status: statusComanda.LIVRATA
      }
    ]
  },
  returnare_comanda: {
    response: ''
  }
};

const RightContent = () => {
  const { Search } = Input;
  const onSearch = (value) => console.log(value);
  return (
    <RightContentWrapper>
      <ChatWrapper>
        <div>
          <DefaultComandsWrapper>
            <DefaultComandWrap>Status comandă</DefaultComandWrap>
            <DefaultComandWrap>Detalii comandă</DefaultComandWrap>
            <DefaultComandWrap>Returnare comandă</DefaultComandWrap>
            <DefaultComandWrap>Ghid de mărimi</DefaultComandWrap>
            <DefaultComandWrap>Alte intrebări</DefaultComandWrap>
          </DefaultComandsWrapper>
          <div>Chat</div>
        </div>
        {/* <Search
          //placeholder="input search text"
          //onSearch={onSearch}
          //style={{ width: '500px' }}
        /> */}
        <input 
          placeholder='Inserați mesajul dumneavoastră'
        />
      </ChatWrapper>
    </RightContentWrapper>
  );
};

export default RightContent;
